    "Tualatin River - Urban Refuge Combating Invasive Species through Learning and
    Participating",nt"tracking_summary": {ntt"total": 5,ntt"recent":
    0nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T23:00:15.080611",nt"name": "tualatin-river-urban-refuge-combating-invasive-species-through-learning-and-participating",nt"isopen":
    false,nt"url": null,nt"notes": "This grant is 2 pronged with a strong focus
    on invasive species outreach and education and a supporting focus on active field
    management of native/invasive species. With more than 80% of Americans now living
    in urban areas, Tualatin River NWR has an enormous opportunity to conduct invasive
    species outreach and education to a large number of people. We recognize an urgent
    need to build awareness of and participation in prevention and management of invasive
    species, both plant and animal, on and off refuge lands. With over 110,000 annual
    visitors and 150-200 annual volunteers, the refuge is well positioned to have an
    exponential impact in educating and fostering conservation. We will accomplish this
    through outreach/training for teachers, volunteer training, on-the-ground inventory
    and control of refuge invasive plants, special events/workshops on native gardening,
    and exhibits for the visiting public. Through conversations and direct feedback,we
    are finding that past participants in similar programs are implementing invasives
    control, often on their own, sometimes bringing issues to staff attention that may
    have been otherwise overlooked.",nt"license_title": "License Not Specified",nt"extras":
